const Gallery = () => {

  return(
    <div className="main">
      <div className="cont shadow">

      </div>
      <style jsx>{`
        .main{
          height: 100%;
          display: flex;
          justify-content: center;
          align-items: center;
          //border: 1px solid red;
        }
        .cont{
          width: 80%;
          height: 70%;
          background: ${color.prim};
        }
      `}
      </style>
    </div>
  )
}

const Main = ()=> {

  return(
    <div className="main">
      <Title word="top greenpost's" />
      <Gallery />
      <style jsx>{`
        .main{
          ${greenBackground()}
          //height: 100vh;
        }
      `}
      </style>
    </div>
  )
}


export default Main;
